import { Mahjong } from "./Mahjong";

export class BMWHexagon implements Mahjong {
    state = "avaliable";
    image = "bmw/BMW-hexagon.png";
}


export class BMWLogo implements Mahjong{
    state = "avaliable";
    image = "bmw/BMW-logo.png";
}
